INSERT INTO `ingredient` VALUES (1,'/images/menu/ingredient/img_partofmeat_rib_sirloin.png','설도','SIRLOIN','아웃백 서로인 부위는 채끝 등심이 끝나는 허리부분에서 분리되는 Top Sirloin(또는 Sirloun butt, 한국명 보섭살or설도)이라는 부위이며 다른 부위에 비해 지방이 적고 근육질이 부드러워서 스테이크로 사용하기에 풍미가 좋습니다. \'아웃백 서로인\'은 아웃백을 대표하는 대표 메뉴이기도 합니다.','KIDS LOVE AUSTRALIAN BEEF','뉴욕스트립 스테이크 원료인 호주 청정우는 호주에서도 가장 청정한 목장에서 태어나는 순간부터 아웃백에 들어오는 순간까지 깨끗하게 관리 받고 안전하게 공급되는 쇠고기입니다.',1),(2,'/images/menu/ingredient/img_partofmeat_rib_eye2.png','꽃등심','RIB EYE','아웃백 립아이는 큰 등심에서 겉부분에 부착된 덧살과 힘줄 등을 제거하여 가운데 부분만 정선한 꽃등심 부위를 사용하고 있으며, 소의 부위 중에서 대표적으로 부드러운 육질로 선호도가 가장 높은 고급 부위입니다. 스테이크로 드실 때 고소하면서 짙은 풍미를 느끼기에 가장 적합한 부위입니다.','KIDS LOVE AUSTRALIAN BEEF','뉴욕스트립 스테이크 원료인 호주 청정우는 호주에서도 가장 청정한 목장에서 태어나는 순간부터 아웃백에 들어오는 순간까지 깨끗하게 관리 받고 안전하게 공급되는 쇠고기입니다.',2),(3,'/images/menu/ingredient/img_partofmeat_rib_tenderloin.png','안심','TENDERLOIN','채끝등심과 척추뼈를 사이에 두고 안쪽에 부착된 부위로 소고기 중 가장 연한 부위로 알려져 있습니다. 소 한마리에서 약 6Kg내외로 생산되는 소량 부위로 지방이 적고 부드러운 맛이 좋아서 스테이크의 풍미를 잘 살려줍니다. 아웃백에서는 샤토 브리앙 포 투 스테이크로 최고급의 안심 스테이크를 맛보실 수 있습니다.','KIDS LOVE AUSTRALIAN BEEF','뉴욕스트립 스테이크 원료인 호주 청정우는 호주에서도 가장 청정한 목장에서 태어나는 순간부터 아웃백에 들어오는 순간까지 깨끗하게 관리 받고 안전하게 공급되는 쇠고기입니다.',3),(4,'/images/menu/ingredient/img_partofmeat_rib_strip.png','채끝등심','STRIP','채끝등심으로 갈비 아래부터 허리까지의 등심부위를 의미하며, 등심에 비해 지방은 다소 적으나 스테이크로서의 풍미는 상당히 좋아서 스테이크 매니아들이 즐겨 찾는 부위입니다.미국의 뉴욕주와 비슷한 모양의 채끝 등심을 특별히 뉴욕스트립으로 부르기도 합니다.','KIDS LOVE AUSTRALIAN BEEF','뉴욕스트립 스테이크 원료인 호주 청정우는 호주에서도 가장 청정한 목장에서 태어나는 순간부터 아웃백에 들어오는 순간까지 깨끗하게 관리 받고 안전하게 공급되는 쇠고기입니다.',4);
