 프랑스산, 220g',10,'매콤달콤한 바비큐 소스를 바른 돼지갈비 요리',3),(14,'기브미 파이브','Gimme Five',30900,'/images/menu/aussie_tizers/grid_20140919004020.png','닭고기, 국내산 / 돼지갈비, 프랑스산 /소고기, 호주산',10,'인기 애피타이저 5가지를 한번에 맛보세요\n(골드 코스트 코코넛 쉬림프, 스파이시 비프 퀘사디아, 레인지랜드 립레츠, 블루밍 머쉬룸, 치킨핑거)',3),(15,'치즈 랍스터 & 쉬림프 케익','Cheese Lobster & Shrimp Cake',32500,'/images/menu/seafood/grid_20140707165521.png','',20,'치즈랍스터와 쉬림프 케익의 콤비네이션 (수프 제공)',4),(16,'웨스턴 그릴드 씨푸드 플래터','Western Grilled Seafood Platter',47900,'/images/menu/seafood/grid_20130522183050.png','',20,'그릴드 랍스터, BBQ 글레이즈드 쉬림프, 케이준 그릴드 스노우 크랩이 함께 제공되는 플래터 (수프 제공)',4),(17,'피시 & 칩스','Fish & Chips',18500,'/images/menu/seafood/grid_20140919021831.png','',20,'바삭하게 튀긴 코드(대구)에 파마산 감자튀김을 함께 제공하는 요리',4),(18,'베이비 백 립 (400g)','Baby Back Ribs',32900,'/images/menu/favorites/grid_20140919014938.png','돼지갈비, 프랑스산, 400g',20,'부드러운 어린 돼지갈비에 아웃백만의 특제 소스를 발라 구워낸 바비큐 요리.\n(소스 선택: 오리지널 바비큐 또는 애플머스타드 소스)',5),(19,'베이비 백 립 (550g)','Baby Back Ribs',37500,'/images/menu/favorites/grid_20140919015133.png','돼지갈비, 프랑스산, 550g',20,'부드러운 어린 돼지갈비에 아웃백만의 특제 소스를 발라 구워낸 바비큐 요리.\n(소스 선택: 오리지널 바비큐 또는 애플머스타드 소스)',5),(20,'버팔로 비프 립','Buffalo Beef Ribs',37500,'/images/menu/favorites/grid_20140702173048.png','소갈비, 호주산, 500g',20,'매콤한 버팔로 소스로 풍미를 더한 텍사스 스타일의 부드러운 비프립',5),(21,'버팔로 비프 & 애플 머스타드 백 립','Buffalo Beef & Apple Mustard Back R',40900,'/images/menu/favorites/grid_20140702175916.png','소갈비, 호주산, 300g/돼지갈비, 프랑스산, 300g',20,'버팔로 비프 립과 애플 머스타드 백 립 을 동시에 맛볼 수 있는 콤보 메뉴',5),(22,'앨리스 스프링 치킨','Alice Springs Chicken',21900,'/images/menu/favorites/grid_20140702153315.png','닭고기.국내산',20,'구운 닭가슴살에 베이컨, 잭치즈, 체다치즈를 올려 오븐에 구운 요리',5),(23,'카카두 그릴러','Kakadu Griller',22900,'/images/menu/favorites/grid_20140701174106.png','소고기, 호주산, 250g',20,'갈비양념에 재워 그릴에서 볶아낸 슬라이스 비프요리',5),(24,'찹 스테이크 플래터','Chopped Steak Platter',22900,'/images/menu/favorites/grid_20140702153024.png','소고기, 호주산, 250g',20,'한국식 갈비소스에 재운 소고기 찹 스테이크',5),(25,'스파이시 치킨 & 쉬림프 스파게티','Spicy chicken & shrimp spaghetti',20500,'/images/menu/pasta/grid_20140919025312.png','닭고기.국내산',15,'담백한 치킨과 신선한 새우에 양파, 마늘로 맛을 더한 매콤하고 고소한 크림소스 파스타',6),(26,'투움바 파스타','Toowoomba Pasta',19900,'/images/menu/pasta/grid_20130523141209.png','',15,'최고급 파마산 치즈와 새우, 양송이를 함께 볶아 깊고 진한 크림소스 파스타',6),(27,'바질 페스토 올리브 파스타','Basil Pesto Olive Pasta',19900,'/images/menu/pasta/grid_20130523141225.png','',15,'새우와 아스파라거스를 볶아 선드라이 토마토, 바질 페스토 소스를 토핑한 올리브오일 파스타',6),(28,'씨푸드 뽀모도로','Seafood Pomodoro',19500,'/images/menu/pasta/grid_20140919024959.png','',15,'쉬림프, 깔라마리가 들어간 후레쉬 토마토 소스 파스타',6),(29,'치킨 까르보나라','Chicken Carbonara',20500,'/images/menu/pasta/grid_20140919025200.png','',15,'그릴드 치킨과 고소한 마늘 치즈 크림소스가 어우러진 정통 까르보나라 파스타',6);
